import OldRingImg from './old-ring.png';

const OldRing = {
  name: 'Old Ring',
  type: 'ring',
  effect: {
    defence: 1,
    hp: 4,
    mana: 1,
  },
  image: OldRingImg,
  value: 25,
};

export default OldRing;
